import React, { useState } from 'react';
import axios from 'axios';
import './css/input.css';
import Banner from './Banner';

function Login() {
    const [email, setEmail] = useState('');         //EMAIL
    const [password, setPassword] = useState('');   //PASSWORD
    const [message, setMessage] = useState('');     // Success or error message
    const [error, setError] = useState(null);       // Error handling

    //ACCOUNT LOGIN
    const handleSubmit = async (e) => {
        e.preventDefault();

        const url = 'http://localhost:5000/api/auth/login';

        // BUTTON PRESSED
        try {
            const response = await axios.post(url, {email, password}, { withCredentials: true });  //BACKEND REQUEST
                                                                      //withCredentials accepts cookies
            if (response.status===200) {
              window.location.href = '/account';
            }
        } catch (error) {
            setError(error.response.data.message);
            setMessage('');   //clear success
        }
    };

    return (
      <div className="bg-[#ffffff] dark:bg-gray-800 w-screen min-h-screen overflow-hidden">
            <Banner />
            <div className='bg-[#101c26] min-h-screen flex items-center'> {/* Use flex for centering */}
                <section className='py-2 w-full'> {/* Full width for the section */}
                    <div className='max-w-lg mx-auto p-4 md:p-16 xl:p-20'>
                        <div className='lg:w-2/3 space-y-5 text-center mx-auto'>
                            <h1 className='text-white uppercase tracking-wides font-medium text-4xl cursor-default'>
                                Login
                            </h1>
                            <div className='h-0.5 bg-red-500 w-14 mx-auto'></div>
                        </div>
                        <div className='flex justify-center'>
                            <div className='grid grid-cols-1 gap-6 mt-10 w-full'> {/* Use w-full to ensure responsiveness */}
                                <div className='lg:col-span-4'>
                                    <form onSubmit={handleSubmit}>
                                        <div className="flex items-center space-x-9 mb-4">
                                            <label className='text-white'>Email:</label>
                                            <input
                                                type="email"
                                                value={email}
                                                onChange={(e) => {
                                                    setEmail(e.target.value);
                                                    setMessage('');
                                                    setError(null);
                                                }}
                                                required
                                                className='border text-gray-900 w-full text-sm rounded focus:ring-0 focus:border-gray-400 block p-2 bg-zinc-700/20 border-zinc-700/50 placeholder:text-gray-300/50 text-white' // Change w-60 to w-full
                                            />
                                        </div>
                                        <div className="flex items-center space-x-2 mb-4">
                                            <label className='text-white'>Password:</label>
                                            <input
                                                type="password"
                                                value={password}
                                                onChange={(e) => {
                                                    setPassword(e.target.value);
                                                    setMessage('');
                                                    setError(null);
                                                }}
                                                required
                                                className="border rounded mb-2 w-full border text-gray-900 text-sm rounded focus:ring-0 focus:border-gray-400 block p-2 bg-zinc-700/20 border-zinc-700/50 placeholder:text-gray-300/50 text-white" // Change w-60 to w-full
                                            />
                                        </div>
                                        <button type="submit" className="bg-red-500 hover:bg-red-600 text-white font-bold py-1 px-3 rounded mb-5">
                                            Login
                                        </button>
                                    </form>
                                    <div className="flex flex-col items-center justify-center text-center">
                                        <span className="cursor-default text-white">
                                            Create an account? <a href="/signup" className="text-red-400">Sign up</a>
                                        </span>
                                        <div className="mt-4 min-w-[800px]">
                                            {message && <p className="success font-bold text-green-500">{message}</p>}
                                            {error && <p className="error font-bold text-red-500">{error}</p>}
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        </div>

    );
}

export default Login;
